import React from 'react';
import './Footer.css';

const Footer = () => {
  const socialLinks = [
    {
      name: 'GitHub',
      icon: '∇',
      url: 'https://github.com/siddhantukhani',
      label: 'Code Repository'
    },
    {
      name: 'LinkedIn',
      icon: '∫',
      url: 'https://www.linkedin.com/in/siddhantukhani/',
      label: 'Professional Network'
    },
    {
      name: 'Email',
      icon: 'λ',
      url: 'mailto:sukhani@stanford.edu',
      label: 'Direct Contact'
    },
    {
      name: 'Research',
      icon: '∑',
      url: '#projects',
      label: 'Academic Work'
    }
  ];

  const quickLinks = [
    { name: 'Home', target: 'home', symbol: '∞' },
    { name: 'About', target: 'about', symbol: '∇' },
    { name: 'Research', target: 'projects', symbol: 'λ' },
    { name: 'Contact', target: 'contact', symbol: '∑' }
  ];

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  return (
    <footer className="footer">
      <div className="mathematical-footer-bg">
        <div className="equation-pattern">∂f/∂x = lim<sub>h→0</sub> [f(x+h) - f(x)]/h</div>
      </div>

      <div className="container">
        <div className="footer-main">
          <div className="footer-brand">
            <h3 className="brand-title">Siddhant Sukhani</h3>
            <p className="brand-subtitle">Computational mathematician creating innovative solutions at the intersection of ML and finance</p>
            <div className="brand-equation">
              <span className="equation">∮ knowledge × innovation dℝ = breakthrough</span>
            </div>
          </div>

          <div className="footer-sections">
            <div className="footer-section">
              <h4 className="section-title">
                <span className="section-symbol">∞</span>Quick Links
              </h4>
              <ul className="link-list">
                {quickLinks.map((link, index) => (
                  <li key={index}>
                    <button 
                      onClick={() => scrollToSection(link.target)}
                      className="nav-link"
                    >
                      <span className="link-symbol">{link.symbol}</span>
                      {link.name}
                    </button>
                  </li>
                ))}
              </ul>
            </div>

            <div className="footer-section">
              <h4 className="section-title">
                <span className="section-symbol">λ</span>Expertise
              </h4>
              <ul className="expertise-list">
                <li>Machine Learning</li>
                <li>Quantitative Finance</li>
                <li>Mathematical Modeling</li>
                <li>NLP Research</li>
              </ul>
            </div>

            <div className="footer-section">
              <h4 className="section-title">
                <span className="section-symbol">∇</span>Connect
              </h4>
              <div className="social-grid">
                {socialLinks.map((link, index) => (
                  <a 
                    key={index}
                    href={link.url}
                    target={link.name === 'Research' ? '_self' : '_blank'}
                    rel={link.name === 'Research' ? '' : 'noopener noreferrer'}
                    className="social-link"
                    onClick={link.name === 'Research' ? (e) => {
                      e.preventDefault();
                      scrollToSection('projects');
                    } : undefined}
                  >
                    <span className="social-icon">{link.icon}</span>
                    <span className="social-label">{link.label}</span>
                  </a>
                ))}
              </div>
            </div>
          </div>
        </div>

        <div className="footer-bottom">
          <div className="copyright">
            <span className="copyright-symbol">©</span>
            <span className="copyright-text">2024 Siddhant Sukhani. All rights reserved.</span>
          </div>

          <button onClick={scrollToTop} className="back-to-top">
            <span className="top-symbol">∆</span>
            <span className="top-text">Top</span>
          </button>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
